function replaceLonelyBrWithP(htmlString) {
    var div = document.createElement('div');
    div.innerHTML = htmlString;
  
    const divs = div.querySelectorAll('div');
  
    divs.forEach(div => {
      // Filter out divs that have exactly one child and that child is a <br>
      if (
        div.childNodes.length === 1 &&
        div.firstChild.nodeName === 'BR'
      ) {
        // Create a new <p> element
        const p = document.createElement('p');
        div.replaceChild(p, div.firstChild);
      }
    });
  
    return div.innerHTML;
}

function getConvertSlashNToNewParaPlugin() {
    return new RichTextEditor.PMExports.prosemirrorState.Plugin({
        props: {
            clipboardTextParser: function(text, $from, plain, view) {
                let marks = $from.marks();
                let { schema } = view.state, serializer = RichTextEditor.PMExports.prosemirrorModel.DOMSerializer.fromSchema(schema);
                let dom = document.createElement("div");
                text.split(/(?:\r\n?|\n)/).forEach(block => {
                    let p = dom.appendChild(document.createElement("p"));
                    if (block) {
                        p.appendChild(serializer.serializeNode(schema.text(block, marks)));
                    }
                });
                return RichTextEditor.PMExports.prosemirrorModel.DOMParser.fromSchema(schema).parseSlice(dom, { preserveWhitespace: view.rteView.options.whiteSpace === "collapse" ? false : true })
            }
        }
    })
}

function getHTMLElFromHTMLString(htmlString) {
    var div = document.createElement('div')
    div.innerHTML = htmlString
    return div.firstChild
}

RichTextEditor.registerElement({
    contentlimit: {
        addPlugin: function(plugins, feature, rteView) {
            let { limit, onLimitExceed } = feature
            let PMState = RichTextEditor.PMExports.prosemirrorState

            let plugin = new PMState.Plugin({
                
                key: new PMState.PluginKey('contentlimit'),

                filterTransaction: (tr) => {
    
                    // Nothing has changed or no limit is defined. Ignore it.
                    if (!tr.docChanged || !limit) {
                        return true
                    }

                    // to get inline styles
                    var domSerializer = RichTextEditor.PMExports.prosemirrorModel.DOMSerializer.fromSchema(rteView.editorView.state.schema)
                    let newHTML = RichTextEditor.getHTML(tr.doc.toJSON(), rteView.options, domSerializer, { inlineStyles: true, cssVariables: false })
                    let newSize = newHTML.length

                    //to get text content
                    // let newText = editorObj.getText(tr.doc.toJSON())
                    // let newSize = newText.length
    
                    if (newSize <= limit) {
                        return true
                    } else {
                        onLimitExceed && onLimitExceed(newSize, rteView)
                        return false
                    }
                }
            })

            plugins.push(plugin)
        }
    }
})


RichTextEditor.registerElement({
    specialTextHighlighter: {
        addNodes: function(schema) {
            return schema.spec.marks.append({
                specialTextHighlighter: {
                    inclusive: false,
                    attrs: {
                        phone: {default: null},
                        mail: {default: null}
                    },
                    parseDOM: [
                        {
                            tag: 'span.special-text',
                            getAttrs: function(el) {
                                var mail, number;
                                if(el.getAttribute('mail')) {
                                    mail = el.getAttribute('mail')
                                    return { mail }
                                } else if(el.getAttribute('phone')) {
                                    phone = el.getAttribute('phone')
                                    return { phone }
                                } else {
                                    return false
                                }
                            }
                        }
                    ],
                    toDOM: function(mark) {
                        // Note: can return a DOM element too
                        if(mark.attrs.mail) {
                            return ['span', 
                                {
                                    class: 'special-text', 
                                    mail : mark.attrs.mail,
                                    style: 'border: 1px solid #999; padding: 1px; border-radius: 2px;'
                                }
                            ]
                        } else if(mark.attrs.phone){
                            return ['span', 
                                {
                                    class: 'special-text', 
                                    phone : mark.attrs.phone,
                                    style: 'border: 1px solid #999; padding: 1px; border-radius: 2px;'
                                }
                            ]
                        }
                    }
                }
            })
        }
    }
})


RichTextEditor.registerElement({
    datafield: {
        addNodes: function(schema) {
            return schema.spec.nodes.append({
                datafield: {
                    atom: true,
                    group: 'inline',
                    inline: true,
                    attrs: {
                        id: '',
                        label: '',
                        meta: {
                            default: {}
                        }
                    },
                    toDOM: function(node) {
                        // Note: can return a DOM element too
                        return ['span', 
                        {
                            class: 'custom-field', 
                            dataFieldId: node.attrs.id, 
                            style: 'border: 1px solid #999; background-color: #f9f9f9; padding: 1px; border-radius: 2px;'
                        }, node.attrs.label]
                    }
                }
            })
        },

        registerCommand: function(view) {
            view.registerCommand({
                insertField: function(fieldAttrs) {
                    fieldAttrs = fieldAttrs ||{id: '101', label: 'Joe Lewis'} 
                    view.insertNode('datafield', fieldAttrs)
                }
            })
        }
    }
})

