                var AllSelection = RichTextEditor.PMExports.prosemirrorState.AllSelection
                var TextSelection = RichTextEditor.PMExports.prosemirrorState.TextSelection
                
                dispatch(tr.setSelection(new AllSelection(doc)))
                
